import { Component, OnInit } from '@angular/core';
import { UbicacionesService } from 'src/app/services/ubicacion.service';

@Component({
  selector: 'app-ubicacion',
  templateUrl: './ubicacion.component.html',
  styleUrls: ['./ubicacion.component.css']
})
export class UbicacionComponent {
  ubicacion:any[]=[];
  error = '';

  constructor(private ubicacionesService: UbicacionComponent) { }

  ngOnInit(): void {
    this.ubicacionesService.getUbicaci().subscribe(
      data => {

        this.productos=data;
        console.log(this.productos)
      },
      err => {
        console.error('Error obteniendo productos:', err);
        this.error = 'Error en el servidor al obtener productos.';
      }
    );
  }

}
